// rafce -> shortcut
import React, { useState } from 'react'
import logo from './imgs/logo.png'
import { Squash as Hamburger } from 'hamburger-react'
import NavBarOpen from './NavBarOpen'
import { Link } from 'react-router-dom'
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import ListItemText from '@material-ui/core/ListItemText';
import axios from 'axios';


const StyledMenu = withStyles({
  paper: {
    border: '1px solid 9c1a1a',
    background: '#171717',
    color: 'white',
  },
  
})((props) => (
  <Menu
    elevation={0}
    getContentAnchorEl={null}
    anchorOrigin={{
      vertical: 'bottom',
      horizontal: 'center',
    }}
    transformOrigin={{
      vertical: 'top',
      horizontal: 'center',
    }}
    {...props}
  />
));

const StyledMenuItem = withStyles((theme) => ({
  root: {
    '&:focus': {
      backgroundColor: "#9c1a1a",
      '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
        color: "white",
      },
    },
  },
}))(MenuItem);


const StyledButton = withStyles({
  root: {
    background: '171717',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 20px',
   // boxShadow: '0 3px 5px 2px rgba(255, 255, 255, .3)',
    margin: "10px 0px 0px 0px",
    fontSize: '20px',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);












const NavbarLoggedin = () => {

  const [isOpen, setOpen] = useState(false);

  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };
  
  const logoutSubmit = (e) => {

    e.preventDefault();
    axios.post(`api/logout`).then(res=>{
      

    })


  }






    

  return (
    <div>
      <nav className="navbar">
        <img src={logo} alt="" className="logo" />
        <ul className="nav-links">
          <li>
            <Link to="/">Autókölcsönzés</Link>
          </li>

          <li>
            <Link to="/modelljeink">Modelljeink</Link>
          </li>
          <li>
            <Link to="/rolunk">Rólunk</Link>
          </li>
          <li>
            <Link to="/husegprogram">Hűségprogram</Link>
          </li>
         
  
              <StyledButton
              aria-controls="customized-menu"
              aria-haspopup="true"
              color="inherit"
              onClick={handleClick}
            >
              Jack ⯆
            </StyledButton>
   
        <StyledMenu
        id="customized-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}>

        <StyledMenuItem>
          <ListItemText primary="Kölcsönzéseim" />
        </StyledMenuItem>
        <StyledMenuItem>
          <ListItemText onClick={logoutSubmit} primary="Kijelentkezés" />
        </StyledMenuItem>
        </StyledMenu>
        
        </ul>
        <Hamburger toggled={isOpen} toggle={setOpen} />
      </nav>
      {isOpen ? <NavBarOpen /> : <navbar />}
    </div>
  )
}

export default NavbarLoggedin
